import React from 'react'
import './l1.css';

function L14() {
  return (
    <>
      <h1>Sentence Structure in Telugu</h1>
      <article>In English, the basic sentence structure is Subject-Verb-Object (SVO). However, in Telugu, the structure is typically Subject-Object-Verb (SOV).</article>
    </>
  )
}

export default L14
